    const isJSON = str => {
        try {
            JSON.parse(str);
            return true;
        } catch (e) {
            return false;
        }
    };
    class TempalteConstrucor {
        constructor(templateButtons) {
            this.templateButtons = templateButtons;
            const places = {
                topRight: {
                    id: "",
                    value: false
                },
                bottomRight: {
                    id: "",
                    value: false
                },
                bottomLeft: {
                    id: "",
                    value: false
                },
                topLeft: {
                    id: "",
                    value: false
                },
                center: {
                    id: "",
                    value: false
                }
            };
            this.places = new Proxy(places, {
                get(target, place) {
                    const isHas = target[place];
                    if (isHas) return target[place]; else return false;
                },
                set: (target, argPlace, value) => {
                    let place = argPlace.replace(/'/g, '"');
                    let isBusy = false;
                    if (isJSON(place)) {
                        isBusy = this.places[place[0]].value || this.places[place[1]].value ? true : false;
                        place = JSON.parse(argPlace);
                    } else isBusy = target[place].value;
                    const {id} = value;
                    if (!isBusy) {
                        for (let key in target) if (target[key]["id"] === id) target[key] = {
                            id: "",
                            value: false
                        };
                        if (typeof place === "string") target[place] = value; else {
                            target[place[0]] = value;
                            target[place[1]] = value;
                        }
                        this.handleDisabledTemplateButtons();
                        return true;
                    } else {
                        target[place] = {
                            id: "",
                            value: false
                        };
                        this.handleDisabledTemplateButtons();
                        return true;
                    }
                }
            });
        }
        clearPlace(id) {
            for (let key in this.places) if (this.places[key]["id"] === id) this.places[key] = {
                id: "",
                value: false
            };
        }
        handleDisabledTemplateButtons() {
            this.templateButtons.forEach((btn => {
                let valuePlace = btn.value.replace(/'/g, '"');
                const id = btn.dataset.templateToggle;
                if (isJSON(valuePlace)) valuePlace = JSON.parse(valuePlace);
                let isDisabled = false;
                if (typeof valuePlace === "string") isDisabled = this.places[valuePlace].value === true && btn.checked === false; else isDisabled = (this.places[valuePlace[0]].value === true && this.places[valuePlace[0]].id !== id || this.places[valuePlace[1]].value === true && this.places[valuePlace[1]].id !== id) && btn.checked === false;
                if (isDisabled) {
                    btn.setAttribute("disabled", "");
                    btn.checked = false;
                } else btn.removeAttribute("disabled");
            }));
        }
        changePlace(item, argPlace) {
            if (!item) return;
            const place = argPlace.replace(/'/g, '"');
            if (!isJSON(place) && !this.places[place]) return; else if (isJSON(place)) {
                const [placeOne, placeTwo] = JSON.parse(place);
                if (!this.places[placeOne] || !this.places[placeTwo]) return;
            }
            item.classList.remove("_top-right", "_top-left", "_bottom-left", "_bottom-right", "_center", "_left", "_right", "_bottom", "_top");
            switch (place) {
              case "topRight":
                this.setPlace(item, "topRight", "_top-right");
                break;

              case "bottomRight":
                this.setPlace(item, "bottomRight", "_bottom-right");
                break;

              case "bottomLeft":
                this.setPlace(item, "bottomLeft", "_bottom-left");
                break;

              case "topLeft":
                this.setPlace(item, "topLeft", "_top-left");
                break;

              case "center":
                this.setPlace(item, "center", "_center");
                break;

              case '["topLeft", "bottomLeft"]':
                this.setPlace(item, '["topLeft", "bottomLeft"]', "_left");
                break;

              case '["topRight", "bottomRight"]':
                this.setPlace(item, '["topRight", "bottomRight"]', "_right");
                break;

              case '["bottomLeft", "bottomRight"]':
                this.setPlace(item, '["bottomLeft", "bottomRight"]', "_bottom");
                break;

              case '["topLeft", "topRight"]':
                this.setPlace(item, '["topLeft", "topRight"]', "_top");
                break;

              default:
                break;
            }
        }
        setPlace(item, argPlace, className) {
            try {
                let place = argPlace.replace(/'/g, '"');
                let isBusy = false;
                if (isJSON(place)) {
                    place = JSON.parse(place);
                    isBusy = this.places[place[0]].value && this.places[place[0]].id !== item.id || this.places[place[1]].value && this.places[place[1]].id !== item.id ? true : false;
                } else this.places[place].value;
                if (isBusy) {
                    const currInputs = document.querySelectorAll(`[data-template-toggle="${item.id}"]`);
                    const currInput = Array.from(currInputs).find((input => input.value === argPlace));
                    currInput.checked = false;
                    currInput.setAttribute("disabled", "");
                    throw new Error("Место занято");
                }
                item.classList.add(className);
                this.places[argPlace] = {
                    id: item.id,
                    value: true
                };
            } catch (e) {
                console.log(e);
            }
        }
    }
    function templateConstructor() {
        const template = document.querySelector(".template");
        if (template) {
            const templateButtons = document.querySelectorAll("[data-template-toggle]");
            const buttonsSpoller = template.querySelectorAll("[data-spoller]");
            const constructor = new TempalteConstrucor(templateButtons);
            constructor.handleDisabledTemplateButtons();
            if (templateButtons.length) templateButtons.forEach((btn => {
                const id = btn.dataset.templateToggle;
                const currentItem = document.querySelector(`#${id}`);
                if (btn.checked) constructor.changePlace(currentItem, btn.value);
                btn.addEventListener("change", (() => {
                    constructor.changePlace(currentItem, btn.value);
                    if (window.getComputedStyle(currentItem).display === "none") currentItem.style.display = "block";
                }));
            }));
            if (buttonsSpoller.length) buttonsSpoller.forEach((btn => {
                btn.addEventListener("click", (() => {
                    const id = btn.dataset.templateItemToggle;
                    if (!id) return;
                    const currentItem = document.querySelector(`#${id}`);
                    const buttons = document.querySelectorAll(`[data-template-toggle="${id}"]`);
                    if (window.getComputedStyle(currentItem).display === "block") {
                        currentItem.style.display = "none";
                        constructor.clearPlace(id);
                        buttons.forEach((btn => btn.checked = false));
                    }
                }));
            }));
        }
    }
    function tab() {
        const buttonsTab = document.querySelectorAll("[data-tab-btn]");
        if (buttonsTab.length) buttonsTab.forEach((btn => {
            const parent = btn.closest(".tab-container");
            const currentTabs = parent.querySelectorAll("[data-tab]");
            const currentButtons = parent.querySelectorAll("[data-tab-btn]");
            const currentImg = parent.querySelector("[data-tab-img]");
            if (currentImg) currentImg.src = currentButtons[0].dataset.img;
            btn.addEventListener("click", (() => {
                const idTab = btn.dataset.tabBtn;
                const srcImg = btn.dataset.img;
                const currentTab = parent.querySelector(`[data-tab="${idTab}"]`);
                if (currentImg) {
                    currentImg.style.opacity = 0;
                    currentImg.src = srcImg;
                    setTimeout((() => currentImg.style.opacity = 1), 200);
                }
                currentTabs.forEach((t => t.classList.remove("_open")));
                currentButtons.forEach((b => b.classList.remove("_active")));
                currentTab.classList.add("_open");
                btn.classList.add("_active");
            }));
        }));
    }
